import './Profile.css';
import './style.css';

import { Link } from "react-router-dom";

export default function ProjectEntry(props) {

    let link = `/${props.name}`

    // <Link to={link}>
    //         <div className = "section-entry" key={props.id}>
    //             <img className = "entry-image" src={props.src}/>
    //             <div className = "entry-title">{props.name}</div>
    //             <div className = "entry-desc">{props.desc}</div>
    //         </div>
    //     </Link>


    return (
        <Link to={link}>
            <div className="section-entry" key={props.id}>
                <img className="entry-image" src={"./content/" + props.src} />
                <div className="entry-title">{props.name}</div>
                <div className="entry-desc">{props.desc}</div>
            </div>
        </Link>

    );

};
